liario Colombia','2025-05-04 13:26:46','2025-05-04 13:26:46'),(16,'subscription-plan','1746372488.3641.jpg','Planes de Suscripci√≥n | Inmobiliaria Roca Romana','Conoce nuestros planes de suscripci√≥n y publica tus propiedades con mayor visibilidad en el porta','planes de suscripci√≥n, publicar propiedades, promoci√≥n inmobiliaria, suscripci√≥n inmobiliaria, aumentar visibilidad, portal inmobiliario Colombia','2025-05-04 13:28:08','2025-05-04 13:28:08'),(17,'terms-and-condition','1746372559.1122.jpg','T√©rminos y Condiciones | Inmobiliaria Roca Romana','Revisa los t√©rminos y condiciones para usar nuestro portal y publicar o buscar propiedades','t√©rminos y condiciones, condiciones de uso, reglas del portal, pol√≠ticas inmobiliarias, uso del sitio web, normativa usuarios, portal inmobiliario Colombia','2025-05-04 13:29:19','2025-05-04 13:29:19'),(18,'profile','1746372617.0948.jpg','Mi Perfil | Inmobiliaria Roca Romana','Accede y gestiona tu perfil, propiedades guardadas y actividad dentro del portal inmobiliario','perfil de usuario, cuenta inmobiliaria, mi cuenta, gestionar perfil, propiedades guardadas, usuario registrado, actividad en portal, portal inmobiliario Colombia','2025-05-04 13:30:17','2025-05-04 13:30:17'),(19,'user-register','1746372791.6475.jpg','Registro de Usuario | Inmobiliaria Roca Romana','Reg√≠strate en nuestro portal inmobiliario para acceder a todas las propiedades y gestionar tu cuenta','registro de usuario, crear cuenta, registrarse portal inmobiliario, acceder a propiedades, cuenta inmobiliaria, portal inmobiliario Colombia, usuarios registrados','2025-05-04 13:33:11','2025-05-04 13:33:11');
