INSERT INTO `settings` VALUES (1,'company_name','ROCA ROMANA',NULL,'2024-10-03 14:16:06'),(2,'currency_symbol','$',NULL,'2024-09-23 23:51:53'),(3,'ios_version','1.0.0',NULL,NULL),(4,'default_language','ES',NULL,'2024-07-27 15:40:53'),(5,'force_update','0',NULL,NULL),(6,'android_version','1.0.0',NULL,NULL),(7,'number_with_suffix','0',NULL,NULL),(8,'maintenance_mode','0',NULL,NULL),(9,'privacy_policy','<p><strong>POL&Iacute;TICA DE DATOS DE NAVEGACI&Oacute;N O COOKIES DEL PORTAL WWW.ROCAROMANA.COM</strong></p>\r\n<p>Por medio de la presente pol&iacute;tica se establece el uso y almacenamiento de los datos de navegaci&oacute;n o Cookies los cuales son analizados a trav&eacute;s de una aplicaci&oacute;n que se ejecuta de manera autom&aacute;tica en el portal de www.rocaromana.com, propiedad de ROCA ROMANA S.A.S. identificada con NIT 901657376-2 y con domicilio principal en la ciudad de Bogot&aacute;, Colombia.</p>\r\n<p>A trav&eacute;s de las cookies, el portal recuerda informaci&oacute;n sobre la visita de los usuarios, lo que permite que se proporcione una mejor y m&aacute;s segura experiencia de navegaci&oacute;n en el mismo. Las cookies se asocian tanto a usuarios an&oacute;nimos, es decir, aquellos que visitan el portal sin identificarse o registrarse, como aquellos que, s&iacute; lo hacen, a trav&eacute;s de los formularios destinados para tal fin. Se aclara que las cookies no son un virus ni un programa de car&aacute;cter malicioso, no da&ntilde;a ni altera la informaci&oacute;n contenido en el dispositivo usado para la navegaci&oacute;n, ni tampoco puede accederse a informaci&oacute;n y datos contenidos en el dispositivo.</p>\r\n<p>Las cookies se crean y/o actualizan en el computador o dispositivo del usuario de manera autom&aacute;tica, cuando &eacute;ste accede al portal www.rocaromana.com, lo cual permite realizar seguimiento a los datos de navegaci&oacute;n o cookies. Se aclara que las cookies s&oacute;lo son le&iacute;das por el sitio web que las cre&oacute;.</p>\r\n<p>Estas cookies son esenciales para el uso del Portal, en el sentido de facilitar el proceso de registro en el mismo, as&iacute; como permitir a los usuarios un acceso m&aacute;s r&aacute;pido y seguro a los servicios seleccionados dentro del Portal. Sin estas cookies, es posible que ROCA ROMANA no les pueda ofrecer a los usuarios ciertos servicios dentro del Portal y &eacute;ste puede que no funcione con normalidad. As&iacute; mismo mediante el uso de estas cookies, ROCA ROMANA podr&aacute; entregarle al usuario publicidad que considere que puede llegar a ser de su inter&eacute;s, seg&uacute;n las preferencias y comportamientos que el usuario tiene o ha tenido dentro del portal web. A trav&eacute;s de estas cookies, se podr&aacute; optimizar la publicidad que el usuario ve en el Portal. Las cookies de publicidad, podr&aacute;n ser entregadas a anunciantes de ROCA ROMANA , para que sean utilizadas por &eacute;stos para sus campa&ntilde;as de mercadeo y publicidad.</p>\r\n<p>Finalmente, a trav&eacute;s de las cookies, ROCA ROMANA o el tercero que &eacute;ste contrate, puede realizar distintos an&aacute;lisis y estudios de la informaci&oacute;n recolectada, con el fin de mejorar los productos y servicios que se ofrecen a los usuarios. ROCA ROMANA y los terceros con los que contrate servicios para el uso de cookies, son los &uacute;nicos que podr&aacute;n acceder a la informaci&oacute;n almacenada en las cookies que se han instalado dentro del equipo del usuario. La informaci&oacute;n almacenada en las cookies no puede ser le&iacute;da por otros usuarios, ni &eacute;stos podr&aacute;n acceder a la misma.</p>\r\n<p>El usuario puede deshabilitar tanto la instalaci&oacute;n de las cookies como el uso de las mismas por parte de ROCA ROMANA. Para deshabilitar la instalaci&oacute;n y uso de cookies el usuario deber&aacute; realizar el procedimiento de acuerdo con el navegador usado (Chrome, Internet Explorer, Mozilla, etc.)</p>\r\n<p>Si el usuario deshabilita la instalaci&oacute;n o el uso de las cookies para el portal, podr&aacute; perder o afectar algunas funcionalidades del sitio, como por ejemplo:</p>\r\n<ul>\r\n<li>Poder ingresar al Portal sin necesidad de indicar en cada ocasi&oacute;n su usuario y contrase&ntilde;a.</li>\r\n<li>Publicaci&oacute;n de comentarios dentro del Portal.</li>\r\n<li>Seguridad en el uso de la informaci&oacute;n que se ingresa en el Portal.</li>\r\n<li>Rapidez en el uso de alg&uacute;n servicio dentro del Portal.</li>\r\n</ul>\r\n<p>ROCA ROMANA podr&aacute; compartir informaci&oacute;n obtenida a trav&eacute;s de las cookies con personas externas o terceros (aliados, clientes, proveedores o empresas vinculadas a ROCA ROMANA con el fin de mejorar la usabilidad y servicios al usuario. As&iacute; mismo, la informaci&oacute;n que se recibe a trav&eacute;s de las cookies ser&aacute; utilizada por ROCA ROMANA y los anteriores terceros, para los fines descritos en el presente documento, los indicados en nuestra Pol&iacute;tica de privacidad, y cualquiera de sus actualizaciones.</p>\r\n<p>ROCA ROMANA podr&aacute; contratar terceras personas encargadas de almacenar y obtener la informaci&oacute;n a trav&eacute;s de las cookies, o que incluyan cookies dentro del portal www.rocaromana.com, personas que podr&aacute;n estar localizadas dentro de Colombia o en el exterior. As&iacute; mismo, ROCA ROMANA podr&aacute; entregar a terceros, la informaci&oacute;n que se obtenga de las cookies para crear perfiles de usuarios, ofrecer campa&ntilde;as personalizadas, sin que lo anterior implique entrega de informaci&oacute;n personal.</p>\r\n<p>La informaci&oacute;n obtenida a trav&eacute;s de estas cookies, referida al equipo del usuario, podr&aacute; ser combinada con sus datos personales s&oacute;lo si usted est&aacute; registrado en el portal www.rocaromana.com.co</p>\r\n<p>La presente Pol&iacute;tica contiene la informaci&oacute;n necesaria que debe conocer todo usuario del Portal sobre el uso de las cookies que realiza ROCA ROMANA o los terceros que &eacute;ste contrate. ROCA ROMANA podr&aacute; modificar el presente documento en cualquier momento y sin previo aviso para mantenerlo vigente y actualizado. Por lo anterior, recomendamos a los usuarios revisar la fecha de elaboraci&oacute;n o actualizaci&oacute;n de los mismos, la cual se establece al final del presente documento.</p>\r\n<p>En caso de dudas o inquietudes acerca del uso de cookies o sobre cualquiera de los puntos detallados en esta Pol&iacute;tica, puede contactarnos a trav&eacute;s del portal web www.rocaromana.com o escribirnos a trav&eacute;s del correo electr&oacute;nico servicioalcliente@rocaromana.com</p>\r\n<p>&nbsp;</p>',NULL,'2024-07-26 14:51:19'),(10,'terms_conditions','<p style=\"text-align: center;\"><strong>T&eacute;rminos y condiciones</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>Cl&aacute;usulas de uso de portal WWW.ROCAROMANA.CO (Web, m&oacute;vil, aplicaciones IOS y android)</p>\r\n<p>WWW.ROCAROMANA.CO pretende dar a los usuarios seguridad en cuanto al empleo de la informaci&oacute;n que aparece en la misma, as&iacute; como la que se desee ingresar a la base de datos. De igual manera, facilitar a los usuarios el acceso a los datos en su portal web, m&oacute;vil y/o aplicaciones (Android e IOS).</p>\r\n<p>La finalidad primordial de la p&aacute;gina en cuesti&oacute;n es poner en conocimiento de los interesados, las ofertas, promociones y demandas de empleo o de adquisici&oacute;n de bienes que terceros publicitan, as&iacute; como la promoci&oacute;n y divulgaci&oacute;n de contenidos comerciales a trav&eacute;s de las plataformas o bases de datos generadas a trav&eacute;s de ellas.</p>\r\n<p>ROCAROMANA.COM, act&uacute;a como portal web, m&oacute;vil y aplicaciones (Android e IOS) de informaci&oacute;n o publicidad, no gener&aacute;ndose por ello, oferta comercial o contractual entre ROCAROMANA.CO y el usuario.</p>\r\n<p>El usuario entonces contratar&aacute; &uacute;nicamente con las empresas o personas naturales enlazadas, sin que exista relaci&oacute;n contractual o de intermediaci&oacute;n por parte de ROCA ROMANA&nbsp; En todo caso, siempre que el usuario pulse un enlace se entender&aacute; que utiliza el portal web, m&oacute;vil y aplicaciones (Android e IOS) de la empresa enlazada, dejando de utilizar el portal web, m&oacute;vil y/o aplicaciones (Android e IOS) de ROCAROMANA.CO, no podr&aacute; el usuario alegar confusi&oacute;n respecto de la marca o empresa con la cual el usuario ha contratado finalmente. La contrataci&oacute;n siempre ser&aacute; entre el usuario y la empresa enlazada.</p>\r\n<p>Al aceptar los t&eacute;rminos y condiciones el usuario acepta que ROCA ROMANA .le env&iacute;e a sus datos de contacto informaci&oacute;n sobre otros productos o servicios relacionados con su actividad dentro del portal ROCAROMANA.CO; como pueden ser inmuebles que tengan caracter&iacute;sticas similares a las de su b&uacute;squeda inicial.</p>\r\n<p>DEFINICIONES:</p>\r\n<ul>\r\n<li>USUARIO PERSONA NATURAL: Todo usuario del portal ROCAROMANA.CO, que sea personal natural, mayor de edad, que no ostente la calidad de comerciante o intermediario en el mercado y que use los servicios del portal para satisfacer necesidades de orden personal, en particular la publicaci&oacute;n o anuncio de inmuebles usados ya sea con servicios gratuitos o pago a trav&eacute;s de la Oficina Virtual.</li>\r\n</ul>\r\n<p><br /><br /></p>\r\n<ul>\r\n<li>USUARIO AGENTE INTERMEDIARIO Y EMPRENDEDORES:&nbsp;Todo usuario del portal, bien sea persona natural o jur&iacute;dica, que ostenta la calidad de comerciante o intermediario en el mercado y que utiliza los servicios del portal en desarrollo de su actividad econ&oacute;mica en relaci&oacute;n con inmuebles usados. Este tipo de usuario podr&aacute; utilizar los servicios del portal exclusivamente a trav&eacute;s de la Oficina Virtual.</li>\r\n</ul>\r\n<p><br /><br /></p>\r\n<ul>\r\n<li>USUARIO CONSTRUCTORA:&nbsp;Todo usuario del portal, que sea persona jur&iacute;dica y cuyo objeto social incluya las actividades relacionadas con la construcci&oacute;n y/o promoci&oacute;n de proyectos inmobiliarios nuevos. Este tipo de usuario podr&aacute; utilizar los servicios del portal exclusivamente a trav&eacute;s de la Oficina Virtual.</li>\r\n</ul>\r\n<p><br /><br /></p>\r\n<ul>\r\n<li>OTRO TIPO DE USUARIO INSTITUCIONAL:&nbsp;Usuarios que sean personas jur&iacute;dicas y cuyo objeto social no incluya las actividades relacionadas con la construcci&oacute;n y/o promoci&oacute;n de proyectos inmobiliarios, o la intermediaci&oacute;n como agentes inmobiliarios; pero que para el desarrollo de su objeto social requieren publicar o anunciar bienes inmuebles usados. Este tipo de usuario podr&aacute; utilizar los servicios del portal exclusivamente a trav&eacute;s de la Oficina Virtual.</li>\r\n</ul>\r\n<p><br /><br /></p>\r\n<ol>\r\n<li>DERECHOS Y OBLIGACIONES DE LAS PARTES:<br /><br /><br /></li>\r\n<ol>\r\n<li>Por parte de ROCAROMANA.CO<br /><br /></li>\r\n</ol>\r\n</ol>\r\n<p>Son obligaciones asumidas por el propietario del portal web-m&oacute;vil y aplicaciones (Android e IOS), en su calidad de proveedor:</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Prestar los servicios suscritos, respondiendo por las reclamaciones que por deficiencia en el servicio realicen los clientes.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Garantizar el secreto de las comunicaciones, reserv&aacute;ndose el derecho a rectificaci&oacute;n de informaciones falsas, il&iacute;citas, o que contravengan la moral y las buenas costumbres.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Respetar el derecho a la intimidad y privacidad del usuario.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Adecuar continuamente su portal web- m&oacute;vil y aplicaciones (Android e IOS), con miras a prestar un eficiente